import React, { Component } from "react";
import Grid from '@material-ui/core/Grid';

import "./App.css";

class DraftingPage extends Component {
  state = {
    draftedPlayers: ["Lebrom James", "Stephen Curry", "Jimmy Butler", "Kemba Walker", "Luka Doncic", "Lou Williams", "James Harden", "Kyrie Irving"],
    playerLists: [],
    userProfile: [],
  };

  componentDidMount() {
    let playerLists = [];
    playerLists.push(
      <p style={{ fontSize: 50, color: "blue" }}>Currently Drafted</p>
    );
    this.state.draftedPlayers.forEach(player => {
      playerLists.push(<p>{player}</p>)
    });

    let profile = [];
    profile.push(<img src={process.env.PUBLIC_URL + '/NBA.jpg'} alt="logo" style={{ width: 114, height: 75 }} />);
    profile.push(<p className="username">{this.props.userName}</p>);
    profile.push(<p className>Win rate: {this.props.winRate}</p>);

    this.setState({
      draftedPlayers: playerLists,
      userProfile: profile,
    })
  }

  render() {
    return (
      <div>
        <Grid container direction="row"
          justify="flex-start"
          alignItems="flex-start" >
          <Grid className="DraftingPage" style={{ padding: 30 }}>
            {/* <img src={process.env.PUBLIC_URL + '/NBA.jpg'} alt="logo" style={{ width: 114, height: 75 }} />
            <p className="username">{this.props.userName}</p>
            <p className>Win rate: {this.props.winRate}</p> */}
            {this.state.userProfile}
            <p style={{ fontSize: 50, color: "red" }}>Players</p>
          </Grid>
          <h1 className="title">Drafting</h1>
          <Grid className="Playerlist">
            {this.state.draftedPlayers}
          </Grid>
        </Grid>

      </div>
    );
  }
}

export default DraftingPage;
